حينَ رأت إحدى بناتُ النبي ﷺ ما رأت من إيذاء المشركين له، قال ﷺ 
"يابنيّة، لا تبكي؛ (فإن الله مانعٌ أباك)"
تَعرّضوهُ بشتى أنواع الإيذاء والتآمر، حتى كفاهُ الله إياهم وأظهره عليهم فكانت الدائرة لمن آمن، وهذا وعد الله لنبيّه ﷺ {إنا كفيناك المستهزئين} وقوله ﷻ {إن شانئك هو الأبتر}
